branchCategory.description:
&lt;p&gt;
The SV series employs a multi-connector instead of the conventional lead wires for internal manifold wiring. By connecting each block with a connector, changes to manifold stations are greatly simplified. Cassette base type manifolds offer the ultimate in flexibility. Manifold sections can be added using a simple release mechanism. Conventional tie-rod base type manifolds are also available. The use of 34 pin connectors allows up to 16 stations with double solenoids.
&lt;/p&gt;

